import axios from "axios";
import React, { useState, useEffect } from "react";
import "./App.css";

function App() {
	const [cpLocation, setCPLocation] = useState("Jelapang");

	const url = `https://data.gov.sg/api/action/datastore_search?resource_id=139a3035-e624-4f56-b63f-89ae28d4ae4c&q=${cpLocation}`;

	useEffect(() => {
		axios.get(url).then((res) => {
			console.log(res.data.result.records);
		});
	}, []);

	return (
		<div className="App">
			<h1>Where to Park?</h1>
		</div>
	);
}

export default App;
